import React from 'react';
import './Footer.css';

function Footer() {
    return (
        <div className="footer">
            <div className="footer-content">
                <div className="branding">
                    <h3>Branding stuff</h3>
                    <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nunc maximus, nulla ut commodo</p>
                </div>
                <div className="logo">
                    <p>LOGO</p>
                </div>
                <div className="social-icons">
                    <img src='data:image/png;base64,' alt="Facebook" className="icon" />
                </div>
            </div>
            <hr />
            <p className="copyright">2020 IoT Â© Copyright all rights reserved, bla bla</p>
        </div>
    );
}

export default Footer;
